#DROP DATABASE IF EXISTS WellcareDB;

CREATE DATABASE IF NOT EXISTS WellcareDB;

USE WellcareDB;


Create  TABLE IF NOT EXISTS patient(
	patient_id int NOT NULL PRIMARY KEY,
	gender VARCHAR(255),
    username VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
    firstName VARCHAR(255),
    lastName VARCHAR(255),
    email VARCHAR(255) NOT NULL,
	phone VARCHAR(255),
    address VARCHAR(255),
    emergency_contact VARCHAR(255),
    dob date,
    profPic VARCHAR(255)
   
);

 Create TABLE IF NOT EXISTS doctor(
	doc_id int NOT NULL PRIMARY KEY auto_increment,
    username VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
    firstName VARCHAR(255),
    lastName VARCHAR(255),
    specialty VARCHAR(255),
    email VARCHAR(255) NOT NULL,
    phone VARCHAR(255),
    address VARCHAR(255),
    rating int,
    profPic VARCHAR(255)
);

 
 Create TABLE IF NOT EXISTS Appointment (
	A_Date date,
    A_Time time,
    appointment_id int generated always AS (A_Date + A_Time) STORED PRIMARY KEY,
    doc_id int NOT NULL,
    user_id int NOT NULL ,
    Reason VARCHAR(255),
    FOREIGN KEY (doc_id) REFERENCES doctor(doc_id),
	FOREIGN KEY (user_id) REFERENCES patient(patient_id)
);
#drop table Appointment;

 Create TABLE IF NOT EXISTS User(
	user_id int NOT NULL PRIMARY KEY auto_increment,
    username VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
	isDoctor int default 0,
	FOREIGN KEY (user_id) REFERENCES doctor(doc_id),
    FOREIGN KEY (user_id) REFERENCES patient(patient_id)
   
);

#DROP TABLE User;


 Create TABLE IF NOT EXISTS avail_Times (
	_Date date,
    _Month int,
    _Day int,
    _Year int,
    _Time time, 
    _avail bit default 1,
	_ID int generated always AS (_Date + _Time) STORED PRIMARY KEY
 );
 
  Create TABLE IF NOT EXISTS perscription(
 
	doc_id int,
	patient_id int,
	start_Date date, 
	Rx_Numb int,
	refill int default 0,
	_ID int generated always AS (patient_id + Rx_Numb)STORED PRIMARY KEY,
	script varchar(255),
	FOREIGN KEY (doc_id) REFERENCES doctor(doc_id),
	FOREIGN KEY (patient_id) REFERENCES patient(patient_id)

 );

Create TABLE IF NOT EXISTS reminders(

	reminder_id int primary key,
    notification_type VARCHAR(255),
    _date Date,
    reminder VARCHAR(255)
    
);

Create TABLE IF NOT EXISTS DocNote(
	dir_id int NOT NULL PRIMARY KEY auto_increment,
	doc_id int NOT NULL,
	patient_id int NOT NULL,
	note varchar(255)NOT NULL,
	FOREIGN KEY (doc_id) REFERENCES doctor(doc_id),
	FOREIGN KEY (patient_id) REFERENCES patient(patient_id)
);


